<?php

namespace Thirty98\Seeder\States\Louisiana;

use Carbon\Carbon;
use Thirty98\API\Stdlib\AbstractDatabaseSeeder;
use Illuminate\Support\Facades\DB;
use Thirty98\Models\City;
use Thirty98\Models\County;
use Thirty98\Models\LACityParishSalesTax;

class LACityParishSalesTaxesSeeder extends AbstractDatabaseSeeder
{
    public $state_code = 'LA';
    protected $table_name = 'cities';

    protected function executeSeeder()
    {
        $count = count($this->getCityParishSalesTaxes());

        // print('City Parish Sales Tax Seeder Count: ' . $count);
        $insertions = 0;

        $counties = County::where('state_code', $this->state_code)->get();
        $countiesIndexes = [];

        $cities = City::all();
        $citiesIndexes = [];

        foreach ($counties as $county) {
            $countiesIndexes[$county['slug']] = $county['id'];
        }

        foreach ($cities as $city) {
            $citiesIndexes[$city['slug']][$city['county_id']] = ['id' => $city['id'], 'county_id' => $city['county_id']];
        }

        foreach ($this->getCityParishSalesTaxes() AS $cityParishSalesTax) {
            // City IDs can be empty.
            if ($cityParishSalesTax['slug'] != "") {
                // Get City ID.
                $cityID = $citiesIndexes[$cityParishSalesTax['slug']][$countiesIndexes[$this->slugit($cityParishSalesTax['county_name'])]]['id'];

                /*if($cityParishSalesTax['slug'] == 'deridder') {
                    die('deridder detected: ' . ' ' . 'city ID: ' . $cityID);
                }*/
            } else {
                $cityID = '';
            }

            $countyID = $countiesIndexes[$this->slugit($cityParishSalesTax['county_name'])];

            $areaTax = $cityParishSalesTax['area_tax'];
            $areaVendorDesc = $cityParishSalesTax['area_vendor_desc'];

            $parishTax = $cityParishSalesTax['parish_tax'];
            $parishVendorDesc = $cityParishSalesTax['parish_vendor_desc'];

            $parishEffectiveDate = Carbon::parse($cityParishSalesTax['parish_effective_date'])->format('Y/m/d');
            $areaEffectiveDate = Carbon::parse($cityParishSalesTax['area_effective_date'])->format('Y/m/d');
            $startDate = Carbon::parse($cityParishSalesTax['start_date'])->format('Y/m/d');
            $endDate = Carbon::parse($cityParishSalesTax['end_date'])->format('Y/m/d');

            $exists = LACityParishSalesTax::where('city_id', $cityID)
                ->where('start_date', $startDate)
                ->where('end_date', $endDate)
                ->where('area_effective_date', $areaEffectiveDate)
                ->where('parish_effective_date', $parishEffectiveDate)
                ->where('area_tax', $areaTax)
                ->where('area_vendor_desc', $areaVendorDesc)
                ->where('parish_tax', $parishTax)
                ->where('parish_vendor_desc', $parishVendorDesc)
                ->first();

            if (!$exists) {
                $resultID = LACityParishSalesTax::insertGetId([
                    'city_id' => $cityID,
                    'county_id' => $countyID,
                    'start_date' => $startDate,
                    'end_date' => $endDate,
                    'area_effective_date' => $areaEffectiveDate,
                    'parish_effective_date' => $parishEffectiveDate,
                    'area_tax' => $areaTax,
                    'area_vendor_desc' => $areaVendorDesc,
                    'parish_tax' => $parishTax,
                    'parish_vendor_desc' => $parishVendorDesc,
                ]);

                // print('Inserted with ID: ' . $resultID . PHP_EOL);
                // print('$cityParishSalesTax[\'slug\']: ' . $cityParishSalesTax['slug'] . PHP_EOL);

                if ($resultID < 1) {
                    die('Not inserted');
                }
            }
        }
    }

